import { createBrowserRouter, RouterProvider, Outlet } from 'react-router-dom';

import HomePage from './pages/HomePage';
import EventsPage from './pages/EventsPage';
import EventDetailPage from './pages/EventDetailPage';
import NewEventPage from './pages/NewEventPage';
import EditEventPage from './pages/EditEventPage';
import MainNavigation from './components/MainNavigation';
import EventsNavigation from './components/EventsNavigation';

const DUMYEVENTS = [
   { id: 'event-1', title: 'tytuł-1' },
   { id: 'event-2', title: 'tytuł-2' },
   { id: 'event-3', title: 'tytuł-3' },
   { id: 'event-4', title: 'tytuł-4' },
];

const router = createBrowserRouter([
   {
      path: '/',
      element: (
         <>
            <MainNavigation />
            <main>
               <Outlet />
            </main>
         </>
      ),
      children: [
         { index: true, element: <HomePage /> },
         {
            path: 'events',
            element: (
               <>
                  <EventsNavigation />
                  <Outlet />
               </>
            ),
            children: [
               { index: true, element: <EventsPage events={DUMYEVENTS} /> },
               { path: 'events/new', element: <NewEventPage /> },
               { path: 'events/:eventID', element: <EventDetailPage allEvents={DUMYEVENTS} /> },
               { path: 'events/:eventID/edit', element: <EditEventPage /> },
            ],
         },
      ],
   },
]);

function App() {
   return <RouterProvider router={router} />;
}

export default App;
